import {Navigate, Route} from "react-router-dom"

function ProtectedRoute ({ component: Component, ...props }) {
    return (
        <Route>
			{() =>
				props.isLogIn ? <Component {...props} /> : <Navigate to="/sign-in"/>
			}
		</Route>
    )
}
